import { BrowserRouter, Router } from "react-router-dom";
Rout
import Register from "./Components/accounts/Register";

function App() {
  return (
    <Router>
      <Route 
              path="/" 
              element={<Login />} 
      />
      <Route 
              path="/login" 
              element={<Login />} 
      />
      <Route 
              path="/register" 
              element={<Register />} 
      />

    </Router>
  )
}

export default App;
